import Product from "./Product";

const ProductList = (props) => {
  return (
  <Row lg={3}>
        {products && props.products.map((product) => {
          const {id, title, price, image, text} = product;
          return (
          <Product
            key={product.id}
            id={product.id}
            image={product.image}
            title={product.title}
            price={product.price}
            text={product.text}
          />
          );
          })}
  </Row>
  );
};

export default ProductList;
